  \"2013-03-15T14:32:30.086044\",\n\t\"name\": \"ecologicstats-cntyfrst\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This datalayer contains Vermont forestry
  estimate data, by county, primarily obtained from the Vermont Forest Inventory and
  Analysis (FIA), conducted in the years; 1966, 1973, 1983, and 1997 by the USDA Forest
  Service. Inventory items for Grand Isle and Franklin Counties have been combined.
  See the 'Attribute Accuracy Report' for reasons. Also included within this database
  are land-use change figures, reflective of the time periods; 1970s-1980s, 1980s-1990s,
  and the 1970s-1990s. This data has been made available by the Orton Family Foundation
  and the UVM School of Natural Resources, Spatial Analysis Lab. One may download
  Excel spreadsheets or comma-delimited ASCII textfiles of this data from the VGIS
  indicators webpage - http://www.vcgi.org/indicators/\",\n\t\"license_title\": null,\n\t\"extras\":
